(4, 'Samsung cho ra mắt sản phẩm thuộc dòng Galaxy A mang tên Galaxy A52 (8GB/256GB).', 'ipad-pro-2021-129-inch-silver-600x60015.jpg', 'Samsung cho ra mắt sản phẩm thuộc dòng Galaxy A mang tên Galaxy A52 (8GB/256GB).', '<h3>&nbsp;</h3>\r\n\r\n<h3><a href=\"https://www.thegioididong.com/samsung\" target=\"_blank\">Samsung</a>&nbsp;cho ra mắt sản phẩm thuộc d&ograve;ng&nbsp;<a href=\"https://www.thegioididong.com/dtdd-samsung-galaxy-a\" target=\"_blank\">Galaxy A</a>&nbsp;mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-a52-8gb-256gb\" target=\"_blank\">Galaxy A52 (8GB/256GB)</a>. Sở hữu vi xử l&yacute; Snapdragon 720G mạnh mẽ bậc nhất, cụm 4 camera c&oacute; độ ph&acirc;n giải l&ecirc;n đến 64 MP v&agrave; một vẻ ngo&agrave;i hiện đại, trẻ trung tr&agrave;n đầy sức sống.</h3>\r\n\r\n<h3>Thiết kế đặc trưng d&ograve;ng Galaxy A</h3>\r\n\r\n<p>Chiếc&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">điện thoại</a>&nbsp;sở hữu m&agrave;n h&igrave;nh Infinity-O đầy hiện đại, 4 m&aacute;y ảnh mặt sau được sắp xếp gọn g&agrave;ng b&ecirc;n trong m&ocirc;-đun h&igrave;nh chữ nhật th&acirc;n thuộc v&agrave; c&aacute;c cạnh viền bo cong nhẹ nh&agrave;ng, uyển chuyển quanh th&acirc;n m&aacute;y, tạo cảm gi&aacute;c dễ chịu khi cầm nắm sử dụng.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236085/amsung-galaxy-a52-02.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy A52 | Thiết kế mặt sau\" src=\"https://cdn.tgdd.vn/Products/Images/42/236085/amsung-galaxy-a52-02.jpg\" /></a></p>\r\n\r\n<p>Series Samsung Galaxy A lần n&agrave;y đ&atilde; được Samsung thiết kế cho bộ m&agrave;u sắc cực kỳ tinh tế l&agrave;: M&agrave;u xanh, t&iacute;m, đen v&agrave; trắng. Bạn c&oacute; thể h&oacute;a th&acirc;n đầy năng động, nhẹ nh&agrave;ng, lịch l&atilde;m hay sang trọng một c&aacute;ch đa dạng bằng c&aacute;ch lựa chọn cho m&igrave;nh một trong những m&agrave;u sắc ưng &yacute; nhất.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236085/amsung-galaxy-a52-13.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy A52 | Đạt chuẩn kháng nước IP67\" src=\"https://cdn.tgdd.vn/Products/Images/42/236085/amsung-galaxy-a52-13.jpg\" /></a></p>\r\n\r\n<p>Smartphone bền bỉ theo thời gian khi trang bị mặt k&iacute;nh cường lực rắn chắc, bảo vệ m&aacute;y khỏi c&aacute;c va đập, trầy xước. Ngo&agrave;i ra, người d&ugrave;ng c&oacute; thể thoải m&aacute;i tham gia một số hoạt động c&oacute; li&ecirc;n quan tới nước dưới độ s&acirc;u 1 m&eacute;t khoảng 30 ph&uacute;t trong sự bảo vệ của chuẩn kh&aacute;ng nước v&agrave; bụi IP67.</p>\r\n\r\n<h3>Hiển thị sắc n&eacute;t sắc, sống động</h3>\r\n\r\n<p>Tấm nền&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/man-hinh-super-amoled-la-gi-905770\" target=\"_blank\">Super AMOLED</a>&nbsp;độ ph&acirc;n giải&nbsp;<a href=\"https://www.thegioididong.com/tin-tuc/do-phan-giai-man-hinh-qhd-hd-fullhd-2k-4k-la-gi--592178#fullhd\" target=\"_blank\">Full HD+</a>&nbsp;được trang bị tr&ecirc;n Galaxy A52 c&oacute; khả năng tiết kiệm điện, cung cấp h&igrave;nh ảnh với m&agrave;u sắc rực rỡ, độ tương phản m&agrave;u sắc cao sẽ mang đến cho bạn những ph&uacute;t gi&acirc;y giải tr&iacute; đ&uacute;ng chất, khiến bạn ch&igrave;m đắm bất tận bằng c&aacute;c c&ocirc;ng nghệ ti&ecirc;n tiến nhất.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236085/amsung-galaxy-a52-01.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy A52 | Tấm nền Super AMOLED cho sắc màu rực rỡ\" src=\"https://cdn.tgdd.vn/Products/Images/42/236085/amsung-galaxy-a52-01.jpg\" /></a></p>\r\n\r\n<p>Để c&oacute; những trải nghiệm tuyệt vời th&igrave; ngo&agrave;i khả năng hiển thị h&igrave;nh ảnh đẹp ra c&ograve;n phải c&oacute; một kh&ocirc;ng gian lớn, Galaxy A52 sở hữu m&agrave;n h&igrave;nh c&oacute; k&iacute;ch thước 6.5 inch kh&aacute; rộng r&atilde;i cho người d&ugrave;ng những trải nghiệm bắt mắt, r&otilde; r&agrave;ng.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236085/amsung-galaxy-a52-08.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy A52 | Hỗ trợ tần số quét cao 90 Hz\" src=\"https://cdn.tgdd.vn/Products/Images/42/236085/amsung-galaxy-a52-08.jpg\" /></a></p>\r\n\r\n<p>Tần số qu&eacute;t của A52 cũng đ&atilde; được n&acirc;ng l&ecirc;n 90 Hz, gi&uacute;p cho những chuyển động được mượt m&agrave; hơn, giờ đ&acirc;y bạn chỉ cần chạm nhẹ v&agrave; Galaxy A52 lướt uyển chuyển theo tay bạn.</p>', 0, NULL, NULL),
(6, 'Không dừng lại ở Realme 8 và Realme 8 Pro, Realme tiếp tục gây ấn tượng khi ra mắt Realme 8 5G.', 'realme-8-5g-blue-1-600x60031.jpg', 'Mẫu điện thoại sở hữu cấu hình phần cứng mới và hỗ trợ kết nối 5G hiện đại mang đến cho bạn những trải nghiệm tuyệt vời với tốc độ mạng cực nhanh dù ở bất cứ đâu.', '<h3>Kh&ocirc;ng dừng lại ở&nbsp;<a href=\"https://www.thegioididong.com/dtdd/realme-8\" target=\"_blank\">Realme 8</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd/realme-8-pro\" target=\"_blank\">Realme 8 Pro</a>,&nbsp;<a href=\"https://www.thegioididong.com/dtdd-realme\" target=\"_blank\">Realme</a>&nbsp;tiếp tục g&acirc;y ấn tượng khi ra mắt&nbsp;<a href=\"https://www.thegioididong.com/dtdd/realme-8-5g\" target=\"_blank\">Realme 8 5G</a>. Mẫu&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">điện thoại</a>&nbsp;sở hữu cấu h&igrave;nh phần cứng mới v&agrave; hỗ trợ kết nối 5G hiện đại mang đến cho bạn những trải nghiệm tuyệt vời với tốc độ mạng cực nhanh d&ugrave; ở bất cứ đ&acirc;u.&nbsp;</h3>\r\n\r\n<h3>Phong c&aacute;ch thiết kế tối giản</h3>\r\n\r\n<p>Kh&ocirc;ng giống như 2 người anh trong c&ugrave;ng series l&agrave; Realme 8 v&agrave; 8 Pro, thiết kế của Realme 8 5G lại c&oacute; phần đơn giản hơn, d&ograve;ng chữ biểu tượng &quot;Dare to Leap&quot; đ&atilde; được loại bỏ để lại mặt lưng trơn nhẵn với hiệu ứng chuyển s&aacute;ng bắt mắt v&agrave; thời trang.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-02.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | Phong cách thiết kế tối giản\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-02.jpg\" /></a></p>\r\n\r\n<p>Realme cố gắng tạo n&ecirc;n th&acirc;n m&aacute;y&nbsp;<a href=\"https://www.thegioididong.com/dtdd-mong-nhe\" target=\"_blank\">mỏng nhẹ</a>&nbsp;nhất c&oacute; thể tr&ecirc;n Realme 8 5G với trọng lượng 185 g v&agrave; độ mỏng 8.5 mm. Tuy kh&ocirc;ng qu&aacute; ấn tượng như 2 phi&ecirc;n bản 4G, nhưng cảm gi&aacute;c cầm Realme 8 5G vẫn rất đầm tay v&agrave; chắc chắn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-05.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | Thân máy mỏng nhẹ với trọng lượng 185 g và độ mỏng 8.5 mm\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-05.jpg\" /></a></p>\r\n\r\n<h3>Cấu h&igrave;nh n&acirc;ng cấp mạnh mẽ hơn</h3>\r\n\r\n<p>Cấu h&igrave;nh c&oacute; lẽ l&agrave; điểm n&acirc;ng cấp đ&aacute;ng ch&uacute; &yacute; nhất tr&ecirc;n Realme 8 5G, khi được trang bị vi xử l&yacute; Dimensity 700 5G, c&aacute;c điểm số hiệu năng đo được đều tương đương so với bộ đ&ocirc;i Realme 8 v&agrave; 8 Pro.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-4.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | Trang bị vi xử lý Dimensity 700 5G\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-4.jpg\" /></a></p>\r\n\r\n<p>Trang bị vi xử l&yacute; tiến tr&igrave;nh 7 nm v&agrave; 8 nh&acirc;n xử l&yacute; mạnh mẽ l&ecirc;n đến 2.2 GHz t&iacute;ch hợp GPU Mali-G57 mang đến xử l&yacute; hiệu suất mạnh mẽ trong khi vẫn tiết kiệm pin tối đa, gi&uacute;p m&aacute;y c&oacute; thể xử l&yacute; những t&aacute;c vụ phức tạp v&agrave; kh&ocirc;ng gặp bất kỳ trở ngại n&agrave;o khi chơi c&aacute;c tựa game đồ họa cao.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-15.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | Tích hợp GPU Mali-G57 mang đến xử lý hiệu suất mạnh mẽ\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-15.jpg\" /></a></p>\r\n\r\n<p>Với&nbsp;<a href=\"https://www.thegioididong.com/dtdd-ram-8gb\" target=\"_blank\">8 GB RAM</a>&nbsp;chuẩn LPDDR4X v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd-rom-128gb\" target=\"_blank\">128 GB bộ nhớ trong</a>, đều l&agrave; những th&ocirc;ng số quen thuộc trong ph&acirc;n kh&uacute;c, đ&oacute;ng g&oacute;p đ&aacute;ng kể v&agrave;o hiệu năng tổng thể v&agrave; mang đến kh&ocirc;ng gian lưu trữ dữ liệu, c&agrave;i đặt ứng dụng thoải m&aacute;i cho người d&ugrave;ng.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-07.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | 8 GB RAM chuẩn LPDDR4X và 128 GB bộ nhớ trong, hỗ trợ thẻ nhớ ngoài\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-07.jpg\" /></a></p>\r\n\r\n<h3>Camera 48 MP sắc n&eacute;t, chụp đ&ecirc;m ấn tượng</h3>\r\n\r\n<p>So với Realme 8 v&agrave; 8 Pro, Realme 8 5G kh&aacute; khi&ecirc;m tốn khi trang bị hệ thống 3 camera sau với camera ch&iacute;nh 48 MP,&nbsp;<a href=\"https://www.thegioididong.com/dtdd-camera-xoa-phong\" target=\"_blank\">camera x&oacute;a ph&ocirc;ng</a>&nbsp;2 MP v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd-camera-macro\" target=\"_blank\">camera macro</a>&nbsp;2 MP, c&oacute; thể đ&acirc;y l&agrave; l&yacute; do gi&uacute;p thiết bị c&oacute; mức gi&aacute; tốt hơn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-03.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | Trang bị hệ thống 3 camera sau sắc nét\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-03.jpg\" /></a></p>\r\n\r\n<p>B&ecirc;n cạnh độ ph&acirc;n giải 48 MP, camera ch&iacute;nh của Realme 8 5G vẫn c&oacute; những th&ocirc;ng số nổi bật kh&aacute;c như hệ thấu k&iacute;nh 6P cao cấp v&agrave; khẩu độ lớn f/1.8. C&oacute; thể thấy Realme 8 5G sẽ tăng cường thu s&aacute;ng v&agrave; xử l&yacute; ảnh th&ocirc;ng minh hơn nhằm cung cấp khả năng chụp đ&ecirc;m mạnh mẽ hơn.</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, NULL),
(7, 'Samsung cho ra mắt sản phẩm thuộc dòng Galaxy A mang tên Galaxy A52 (8GB/256GB).', 'apple-watch-s6-40mm-vien-nhom-day-cao-su-ava-600x60078.jpg', 'Samsung cho ra mắt sản phẩm thuộc dòng Galaxy A mang tên Galaxy A52 (8GB/256GB).', '<h3>Kh&ocirc;ng dừng lại ở&nbsp;<a href=\"https://www.thegioididong.com/dtdd/realme-8\" target=\"_blank\">Realme 8</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd/realme-8-pro\" target=\"_blank\">Realme 8 Pro</a>,&nbsp;<a href=\"https://www.thegioididong.com/dtdd-realme\" target=\"_blank\">Realme</a>&nbsp;tiếp tục g&acirc;y ấn tượng khi ra mắt&nbsp;<a href=\"https://www.thegioididong.com/dtdd/realme-8-5g\" target=\"_blank\">Realme 8 5G</a>. Mẫu&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">điện thoại</a>&nbsp;sở hữu cấu h&igrave;nh phần cứng mới v&agrave; hỗ trợ kết nối 5G hiện đại mang đến cho bạn những trải nghiệm tuyệt vời với tốc độ mạng cực nhanh d&ugrave; ở bất cứ đ&acirc;u.&nbsp;</h3>\r\n\r\n<h3>Phong c&aacute;ch thiết kế tối giản</h3>\r\n\r\n<p>Kh&ocirc;ng giống như 2 người anh trong c&ugrave;ng series l&agrave; Realme 8 v&agrave; 8 Pro, thiết kế của Realme 8 5G lại c&oacute; phần đơn giản hơn, d&ograve;ng chữ biểu tượng &quot;Dare to Leap&quot; đ&atilde; được loại bỏ để lại mặt lưng trơn nhẵn với hiệu ứng chuyển s&aacute;ng bắt mắt v&agrave; thời trang.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-02.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | Phong cách thiết kế tối giản\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-02.jpg\" /></a></p>\r\n\r\n<p>Realme cố gắng tạo n&ecirc;n th&acirc;n m&aacute;y&nbsp;<a href=\"https://www.thegioididong.com/dtdd-mong-nhe\" target=\"_blank\">mỏng nhẹ</a>&nbsp;nhất c&oacute; thể tr&ecirc;n Realme 8 5G với trọng lượng 185 g v&agrave; độ mỏng 8.5 mm. Tuy kh&ocirc;ng qu&aacute; ấn tượng như 2 phi&ecirc;n bản 4G, nhưng cảm gi&aacute;c cầm Realme 8 5G vẫn rất đầm tay v&agrave; chắc chắn