trữ dữ liệu, c&agrave;i đặt ứng dụng thoải m&aacute;i cho người d&ugrave;ng.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-07.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | 8 GB RAM chuẩn LPDDR4X và 128 GB bộ nhớ trong, hỗ trợ thẻ nhớ ngoài\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-07.jpg\" /></a></p>\r\n\r\n<h3>Camera 48 MP sắc n&eacute;t, chụp đ&ecirc;m ấn tượng</h3>\r\n\r\n<p>So với Realme 8 v&agrave; 8 Pro, Realme 8 5G kh&aacute; khi&ecirc;m tốn khi trang bị hệ thống 3 camera sau với camera ch&iacute;nh 48 MP,&nbsp;<a href=\"https://www.thegioididong.com/dtdd-camera-xoa-phong\" target=\"_blank\">camera x&oacute;a ph&ocirc;ng</a>&nbsp;2 MP v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd-camera-macro\" target=\"_blank\">camera macro</a>&nbsp;2 MP, c&oacute; thể đ&acirc;y l&agrave; l&yacute; do gi&uacute;p thiết bị c&oacute; mức gi&aacute; tốt hơn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/236588/realme-8-5g-03.jpg\" onclick=\"return false;\"><img alt=\"Realme 8 5G | Trang bị hệ thống 3 camera sau sắc nét\" src=\"https://cdn.tgdd.vn/Products/Images/42/236588/realme-8-5g-03.jpg\" /></a></p>\r\n\r\n<p>B&ecirc;n cạnh độ ph&acirc;n giải 48 MP, camera ch&iacute;nh của Realme 8 5G vẫn c&oacute; những th&ocirc;ng số nổi bật kh&aacute;c như hệ thấu k&iacute;nh 6P cao cấp v&agrave; khẩu độ lớn f/1.8. C&oacute; thể thấy Realme 8 5G sẽ tăng cường thu s&aacute;ng v&agrave; xử l&yacute; ảnh th&ocirc;ng minh hơn nhằm cung cấp khả năng chụp đ&ecirc;m mạnh mẽ hơn.</p>', 0, NULL, NULL),
(8, 'Samsung cho ra mắt sản phẩm thuộc dòng Galaxy A mang tên Galaxy A52 (8GB/256GB).', 'apple-watch-s6-40mm-vien-nhom-day-cao-su-ava-600x60089.jpg', 'Samsung cho ra mắt sản phẩm thuộc dòng Galaxy A mang tên Galaxy A52 (8GB/256GB).', '<h3>G&acirc;y ấn tượng với bộ tứ camera thời thượng, hiệu năng ổn định mang đến sự mượt m&agrave; trong mọi t&aacute;c vụ, c&ugrave;ng thời lượng pin ấn tượng,&nbsp;<a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-a12-6gb\" target=\"_blank\">Galaxy A12 (6GB/128GB)</a>&nbsp;sẽ l&agrave; mẫu&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">smartphone</a>&nbsp;đ&aacute;ng mua nhất trong ph&acirc;n kh&uacute;c tầm trung gi&aacute; rẻ của&nbsp;<a href=\"https://www.thegioididong.com/samsung\" target=\"_blank\">Samsung</a>.</h3>\r\n\r\n<h3>Thiết kế thời trang v&agrave; hợp xu hướng</h3>\r\n\r\n<p>Samsung Galaxy A12 l&agrave; mẫu smartphone hướng đến đối tượng giới trẻ với những m&agrave;u sắc trẻ trung năng động, đại diện cho những c&aacute; t&iacute;nh ri&ecirc;ng của giới trẻ hiện đại.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/232364/samsung-galaxy-a12-6gb-274820-124855.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy A12 | Thiết kế chắc chắn bền bỉ\" src=\"https://cdn.tgdd.vn/Products/Images/42/232364/samsung-galaxy-a12-6gb-274820-124855.jpg\" /></a></p>\r\n\r\n<p>Mặt lưng phẳng, phủ nh&aacute;m hạn chế b&aacute;m v&acirc;n tay, c&ugrave;ng phần cạnh viền được l&agrave;m cong vừa phải, Samsung Galaxy A12 hứa hẹn mang đến sự chắc chắn v&agrave; thoải m&aacute;i trong mọi thao t&aacute;c sử dụng h&agrave;ng ng&agrave;y.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/232364/samsung-galaxy-a12-6gb-xanh-duong-8-org-1.jpg\" onclick=\"return false;\"><img alt=\"Điện thoại Samsung Galaxy A12 (6 GB/128 GB) | Cạnh viền bo cong, độ mỏng ấn tượng\" src=\"https://cdn.tgdd.vn/Products/Images/42/232364/samsung-galaxy-a12-6gb-xanh-duong-8-org-1.jpg\" /></a></p>\r\n\r\n<h3>Mở rộng tầm mắt với m&agrave;n h&igrave;nh Infinity-V si&ecirc;u lớn</h3>\r\n\r\n<p>Sở hữu m&agrave;n h&igrave;nh 6.5 inch&nbsp;<a href=\"https://www.thegioididong.com/dtdd-man-hinh-tran-vien\" target=\"_blank\">tr&agrave;n viền</a>, thiết kế Infinity-V với r&atilde;nh giọt nước si&ecirc;u nhỏ, Galaxy A12 mở ra thế giới giải tr&iacute; rộng lớn, m&agrave; trong đ&oacute; bạn sẽ kh&aacute;m ph&aacute; nhiều nội dung hơn, thỏa th&iacute;ch chơi game, hay đắm ch&igrave;m v&agrave;o những bộ phim gay cấn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/232364/samsung-galaxy-a12-6gb-xanh-duong-4-org-1.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy A12 | Màn hình TFT LCD có độ phân giải HD+ kích thước 6.5 inch\" src=\"https://cdn.tgdd.vn/Products/Images/42/232364/samsung-galaxy-a12-6gb-xanh-duong-4-org-1.jpg\" /></a></p>\r\n\r\n<p>Độ ph&acirc;n giải HD+, tỉ lệ khung h&igrave;nh 16:9, gi&uacute;p cho c&aacute;c h&igrave;nh ảnh hiển thị sắc n&eacute;t hơn, tối ưu trải nghiệm của bạn tr&ecirc;n một m&agrave;n h&igrave;nh lớn.</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, NULL);

