(28, 'Apple Watch S6 40mm viền nhôm dây cao su hồng', 11, 6, '<h3><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-apple-watch-s6\" target=\"_blank\">Apple Watch S6</a>&nbsp;mang đến những n&acirc;ng cấp hữu &iacute;ch để hỗ trợ người d&ugrave;ng một c&aacute;ch tối ưu nhất. Nổi bật trong số đ&oacute; l&agrave; chip xử l&yacute; S6 cải thiện hiệu năng, hệ điều h&agrave;nh watchOS 7 với nhiều t&iacute;nh năng mới hứa hẹn sẽ mang đến những trải nghiệm tốt hơn, th&uacute; vị hơn</h3>\r\n\r\n<h3>Thiết kế sang trọng, hiện đại, l&agrave; phụ kiện thời trang khẳng định đẳng cấp</h3>\r\n\r\n<p>Chiếc&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/apple-watch-s6-40mm-vien-nhom-day-cao-su\" target=\"_blank\">Apple Watch S6 40mm viền nh&ocirc;m d&acirc;y cao su</a>&nbsp;n&agrave;y vẫn giữ trọn vẹn n&eacute;t tinh tế v&agrave; sắc sảo trong thiết kế từ trước đến nay, mặt k&iacute;nh&nbsp;Ion-X strengthened glass&nbsp;ưu việt, viền nh&ocirc;m được v&aacute;t gọt c&ocirc;ng phu v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=silicon\" target=\"_blank\">d&acirc;y đeo cao su</a>&nbsp;co d&atilde;n tốt, &ecirc;m tay.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch S6 với thiết kế sang trọng và hiện đại\" src=\"https://cdn.tgdd.vn/Products/Images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su.jpg\" /></a></p>\r\n\r\n<h3>C&ocirc;ng nghệ mới gi&uacute;p bạn quản l&yacute; v&agrave; theo d&otilde;i sức khỏe của bản th&acirc;n dễ d&agrave;ng, khoa học hơn</h3>\r\n\r\n<p>S&aacute;ng gi&aacute; nhất trong đợt update lần n&agrave;y ch&iacute;nh l&agrave; t&iacute;nh năng đo nồng độ oxy trong m&aacute;u SpO2 v&agrave; điện t&acirc;m đồ ECG:</p>\r\n\r\n<p>- Cụm đ&egrave;n&nbsp;LED v&agrave; hồng ngoại chiếu &aacute;nh s&aacute;ng s&acirc;u v&agrave;o c&aacute;c mạch m&aacute;u ở cổ tay, diode quang đo lượng &aacute;nh s&aacute;ng phản xạ trở lại c&ugrave;ng với c&aacute;c thuật to&aacute;n n&acirc;ng cao sẽ t&iacute;nh to&aacute;n m&agrave;u m&aacute;u của bạn từ đ&oacute; cho biết lượng oxy hiện c&oacute;.</p>\r\n\r\n<p>- Ứng dụng ECG của Apple Watch Series 6 c&oacute; khả năng tạo ECG tương tự như điện t&acirc;m đồ. Đ&acirc;y&nbsp;l&agrave; một th&agrave;nh tựu quan trọng khi một chiếc đồng hồ c&oacute; thể mang lại những dữ liệu đ&aacute;ng gi&aacute; cho c&aacute;c b&aacute;c sĩ v&agrave; cả sự an t&acirc;m cho bạn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-suzz.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch S6 nổi bật với tính năng đo nồng độ oxi trong máu (SpO2) và điện tâm đồ ECG\" src=\"https://cdn.tgdd.vn/Products/Images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-suzz.jpg\" /></a></p>\r\n\r\n<h3>Chip xử l&yacute; S6 nhanh hơn tới 20% so với S5</h3>\r\n\r\n<p>Một ưu điểm phải kể đến của d&ograve;ng&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-apple\" target=\"_blank\">Apple Watch</a>&nbsp;S6 n&agrave;y đ&oacute; l&agrave; chip xử l&yacute; S6&nbsp;cải thiện hiệu năng th&ecirc;m 20% so với ở thế hệ S5 gi&uacute;p n&acirc;ng cao sự mượt m&agrave; v&agrave; độ ch&iacute;nh x&aacute;c, đem đến những trải nghiệm tốt hơn cho người d&ugrave;ng.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su-254420-074413.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch S6 trang bị chip xử lý thế hệ S6 nhanh hơn 20% so với S5\" src=\"https://cdn.tgdd.vn/Products/Images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su-254420-074413.jpg\" /></a></p>\r\n\r\n<h3>Hệ điều h&agrave;nh WatchOS 7 mang đến nhiều t&iacute;nh năng mới hỗ trợ người d&ugrave;ng tối ưu</h3>\r\n\r\n<p>WatchOS 7 tr&ecirc;n Apple Watch series 6 được điều chỉnh để tối ưu h&oacute;a việc theo d&otilde;i chế độ luyện tập, ra mắt dịch vụ fitness hỗ trợ tập luyện hiệu quả qua c&aacute;c chương tr&igrave;nh như: Yoga, đạp xe, nhảy, chạy, bơi lội,... Đồng thời trang bị th&ecirc;m nhiều t&iacute;nh năng hữu &iacute;ch nổi bật như&nbsp;Family Setup, nhận biết rửa tay, chia sẻ m&agrave;n h&igrave;nh qua iMessage, Siri dịch nhanh,...</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su-254420-074419.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch S6 có hệ điều hành watchOS 7 với nhiều tính năng mới hữu ích\" src=\"https://cdn.tgdd.vn/Products/Images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su-254420-074419.jpg\" /></a></p>\r\n\r\n<h3>M&agrave;n h&igrave;nh OLED Retina lu&ocirc;n lu&ocirc;n hiển thị gi&uacute;p bạn xem giờ v&agrave; th&ocirc;ng b&aacute;o thuận tiện</h3>\r\n\r\n<p>- M&agrave;n h&igrave;nh của đồng hồ&nbsp;sử dụng tấm nền OLED cao cấp mang đến độ sắc n&eacute;t ch&acirc;n thực v&agrave; gi&uacute;p tiết kiệm pin.</p>\r\n\r\n<p>- T&iacute;nh năng&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=man-hinh-luon-hien-thi\" target=\"_blank\">m&agrave;n h&igrave;nh lu&ocirc;n hiển thị</a>&nbsp;(Always-on) ở đồng hồ th&ocirc;ng minh Apple 6 giống với d&ograve;ng Apple Watch series 5 nhưng ưu điểm l&agrave; m&agrave;n h&igrave;nh&nbsp;ở chế độ chờ s&aacute;ng hơn 2.5 lần nhưng kh&ocirc;ng g&acirc;y tốn pin hơn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su-254320-074323.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch S6 sở hữu mà hình OLED luôn hiển thị với độ sắc nét cao\" src=\"https://cdn.tgdd.vn/Products/Images/7077/229044/apple-watch-s6-40mm-vien-nhom-day-cao-su-254320-074323.jpg\" /></a></p>', '<p><img src=\"data:image/png;base64,\" style=\"height:555px; width:624px\" /></p>', '11990000', 'apple-watch-s6-40mm-vien-nhom-day-cao-su-ava-600x60029.jpg', 0, 0, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(29, 'Samsung Galaxy Watch Active 2 44mm viền nhôm dây sillicone', 11, 7, '<p>&nbsp;</p>\r\n\r\n<h2><a href=\"https://www.thegioididong.com/dong-ho-thong-minh/samsung-galaxy-watch-active-2-44-mm-sillicon\" target=\"_blank\">Đồng hồ th&ocirc;ng minh Samsung Galaxy Watch Active 2</a>&nbsp;cải tiến hơn với m&agrave;n h&igrave;nh chống ch&oacute;i, hiển thị th&ocirc;ng tin sắc n&eacute;t. C&aacute;c tiện &iacute;ch kh&aacute;c cũng được n&acirc;ng cấp nhằm mang lại sự tiện lợi nhất cho người d&ugrave;ng.</h2>\r\n\r\n<h3>Sang trọng, thời trang</h3>\r\n\r\n<p>Galaxy Watch Active 2 mang thiết kế gọn g&agrave;ng, mặt k&iacute;nh tr&ograve;n 44 mm viền cong sang trọng t&ocirc;n d&aacute;ng tay. D&acirc;y đeo chất liệu Sillicone mềm mại c&oacute; thể th&aacute;o rời tiện lợi để bạn thay m&agrave;u d&acirc;y t&ugrave;y &yacute;.&nbsp;</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/212620/samsung-galaxy-watch-active-2-44-mm-sillicon2-2.jpg\" onclick=\"return false;\"><img alt=\"Thiết kế đồng hồ thông minh Samsung Galaxy Watch Active 2 \" src=\"https://cdn.tgdd.vn/Products/Images/7077/212620/samsung-galaxy-watch-active-2-44-mm-sillicon2-2.jpg\" /></a></p>\r\n\r\n<p>Z</p>', '<h2><img src=\"data:image/png;base64,\" /></h2>', '4990000', 'samsung-galaxy-watch-active-2-44-mm-sillicon-01-600x6001.jpg', 0, 0, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(30, 'Vòng đeo tay thông minh Mi Band 5 (Màu đen sang trọng)', 11, 5, '<h3>Mang kiểu d&aacute;ng thể thao v&agrave; nhỏ gọn</h3>\r\n\r\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh/mi-band-5\" target=\"_blank\">V&ograve;ng đeo tay th&ocirc;ng minh Mi Band 5</a>&nbsp;c&oacute; m&agrave;n h&igrave;nh 1.1 inch c&ugrave;ng độ ph&acirc;n giải l&agrave; 126 x 294 pixels, lớn hơn so với phi&ecirc;n bản&nbsp;0.95 inch của&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/mi-band-4\" target=\"_blank\">Mi Band 4</a>.&nbsp;Mật độ điểm ảnh tr&ecirc;n Mi Band 5 được n&acirc;ng cấp l&ecirc;n đến 300ppi, v&igrave; thế người d&ugrave;ng c&oacute; thể quan s&aacute;t c&aacute;c th&ocirc;ng b&aacute;o r&otilde; r&agrave;ng tr&ecirc;n m&agrave;n h&igrave;nh.&nbsp;<a href=\"https://www.thegioididong.com/day-dong-ho\" target=\"_blank\">D&acirc;y đeo</a>&nbsp;l&agrave;m từ silicone với thiết kế&nbsp;&ocirc;m trọn cổ tay, mang lại cảm gi&aacute;c v&ocirc; c&ugrave;ng mềm mại v&agrave; kh&ocirc;ng bị phai m&agrave;u khi sử dụng sau một thời gian d&agrave;i.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/225949/mi-band-5-1.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 5 mang thiết kế nhỏ gọn và thể thao\" src=\"https://cdn.tgdd.vn/Products/Images/7077/225949/mi-band-5-1.jpg\" /></a></p>\r\n\r\n<h3>C&ocirc;ng nghệ m&agrave;n h&igrave;nh AMOLED&nbsp;</h3>\r\n\r\n<p>M&agrave;n h&igrave;nh cảm ứng&nbsp;<a href=\"https://www.thegioididong.com/tin-tuc/loai-man-hinh-tft-lcd-amoled-la-gi--592346\" target=\"_blank\">AMOLED</a>&nbsp;v&agrave; độ s&aacute;ng tối đa của bảng điều khiển được tăng cường l&ecirc;n ngưỡng 450 nits, điều n&agrave;y gi&uacute;p n&acirc;ng cao chất lượng h&igrave;nh ảnh đầu ra từ c&aacute;c vị tr&iacute; g&oacute;c nh&igrave;n mở rộng, cho khả năng hiển thị ngo&agrave;i trời được tốt hơn. Mặt k&iacute;nh cường lực bảo vệ đồng hồ khi&nbsp;va&nbsp;đập v&agrave;&nbsp;trầy xước, tăng&nbsp;độ bền cho thiết bị.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/7077/225949/mi-band-5-write3.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 5 sử dụng màn hình AMOLED cho hình ảnh được sắc nét\" src=\"https://cdn.tgdd.vn/Products/Images/7077/225949/mi-band-5-write3.jpg\" /></a></p>\r\n\r\n<ul>\r\n	<li>&nbsp;</li>\r\n</ul>', '<h3><img src=\"data:image/png;base64,\" /></h3>', '650000', 'mi-band-5-thumb-600x6004.jpg', 0, 0, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(31, 'Máy tính bảng iPad Air 4 Wifi 64GB (2020)', 10, 6, '<h3><a href=\"https://www.thegioididong.com/apple\" target=\"_blank\">Apple</a>&nbsp;đ&atilde; tr&igrave;nh l&agrave;ng m&aacute;y t&iacute;nh bảng&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang/ipad-air-4-wifi-64gb-2020\" target=\"_blank\">iPad Air 4 Wifi 64 GB (2020)</a>. Đ&acirc;y l&agrave; thiết bị đầu ti&ecirc;n của h&atilde;ng được trang bị chip A14 Bionic - chip di động mạnh nhất của Apple (năm 2020). V&agrave; c&oacute; m&agrave;n lột x&aacute;c nhờ thiết kế được thừa hưởng từ&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang-apple-ipad-pro\" target=\"_blank\">iPad Pro</a>&nbsp;với viền m&agrave;n h&igrave;nh mỏng bo cong quanh m&aacute;y.</h3>\r\n\r\n<h3>Chip mạnh h&agrave;ng đầu cho trải nghiệm ho&agrave;n hảo</h3>\r\n\r\n<p>Apple trang bị cho&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang-apple-ipad-air\" target=\"_blank\">iPad Air</a>&nbsp;4 chip A14 Bionic 6 nh&acirc;n được sản xuất bởi TSMC với tiến tr&igrave;nh 5 nm hiện đại nhất hiện nay. Số lượng b&oacute;ng b&aacute;n dẫn đạt 11.8 tỷ cao hơn 40% so với A13 Bionic (8.5 tỷ). C&oacute; thể thấy số lượng b&oacute;ng b&aacute;n dẫn c&agrave;ng lớn th&igrave; chip c&agrave;ng mạnh v&agrave; tiết kiệm năng lượng hơn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/228808/ipad-air-4-wifi-64gb-2020-183320-033337.jpg\" onclick=\"return false;\"><img alt=\"Trang bị chip A14 mạnh hàng đầu của Apple | iPad Air 2020\" src=\"https://cdn.tgdd.vn/Products/Images/522/228808/ipad-air-4-wifi-64gb-2020-183320-033337.jpg\" /></a></p>\r\n\r\n<p>A14 Bionic c&oacute; 6 l&otilde;i chip, trong đ&oacute; 2 l&otilde;i hiệu suất cao cho t&aacute;c vụ phức tạp v&agrave; 4 l&otilde;i c&ograve;n lại cho c&aacute;c t&aacute;c vụ th&ocirc;ng thường.</p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, bộ xử l&yacute; đồ hoạ GPU 4 l&otilde;i mang lại hiệu suất tối đa, nhanh hơn 30% so với thế hệ trước hứa hẹn iPad Air c&oacute; thể chơi c&aacute;c tr&ograve; chơi phức tạp đ&ograve;i hỏi độ ph&acirc;n giải cao, video 4K,...</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/228808/ipad-air-4-wifi-64gb-2020-181220-051239.jpg\" onclick=\"return false;\"><img alt=\"Chơi game hay nặng hay xem video 4K đều mượt mà | iPad Air 2020\" src=\"https://cdn.tgdd.vn/Products/Images/522/228808/ipad-air-4-wifi-64gb-2020-181220-051239.jpg\" /></a></p>\r\n\r\n<p>A14 Bionic mang đến tốc độ xử l&yacute; vượt trội, nhanh ch&oacute;ng hơn c&ugrave;ng với khả năng xử l&yacute; đa nhiệm mượt m&agrave; cũng như bộ nhớ trong 64 GB cho bạn kh&ocirc;ng gian lưu trữ h&igrave;nh ảnh, video,...</p>', '<p>Cấu h&igrave;nh M&aacute;y t&iacute;nh bảng iPad Air 4 Wifi 64GB (2020)</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>M&agrave;n h&igrave;nh:</p>\r\n\r\n	<p>10.9&quot;Liquid Retina</p>\r\n	</li>\r\n	<li>\r\n	<p>Hệ điều h&agrave;nh:</p>\r\n\r\n	<p>iPadOS 14</p>\r\n	</li>\r\n	<li>\r\n	<p>Chip:</p>\r\n\r\n	<p>Apple A14 Bionic</p>\r\n	</li>\r\n	<li>\r\n	<p>RAM:</p>\r\n\r\n	<p>4 GB</p>\r\n	</li>\r\n	<li>\r\n	<p>Bộ nhớ trong:</p>\r\n\r\n	<p>64 GB</p>\r\n	</li>\r\n	<li>\r\n	<p>Kết nối:</p>\r\n\r\n	<p>Nghe gọi qua FaceTime</p>\r\n	</li>\r\n	<li>\r\n	<p>Camera sau:</p>\r\n\r\n	<p>12 MP</p>\r\n	</li>\r\n	<li>\r\n	<p>Camera trước:</p>\r\n\r\n	<p>7 MP</p>\r\n	</li>\r\n	<li>\r\n	<p>Pin, Sạc:</p>\r\n\r\n	<p>28.65 Wh (~ 7600 mAh)20 W</p>\r\n	</li>\r\n</ul>', '16790000', 'ipad-air-4-wifi-64gb-2020-xanhduong-600x600-200x20046.jpg', 0, 0, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(32, 'Máy tính bảng Samsung Galaxy Tab A7 Lite', 10, 7, '<h3><a href=\"https://www.thegioididong.com/may-tinh-bang/samsung-galaxy-tab-a7-lite\" target=\"_blank\">Galaxy Tab A7 Lite</a>&nbsp;l&agrave; phi&ecirc;n bản r&uacute;t gọn của&nbsp;d&ograve;ng&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang\" target=\"_blank\">m&aacute;y t&iacute;nh bảng</a>&nbsp;&quot;ăn kh&aacute;ch&quot;&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang/samsung-galaxy-tab-a7-2020\" target=\"_blank\">Galaxy Tab A7</a>&nbsp;thuộc thương hiệu&nbsp;<a href=\"https://www.thegioididong.com/samsung\" target=\"_blank\">Samsung</a>, đ&aacute;p ứng nhu cầu giải tr&iacute; của&nbsp;kh&aacute;ch h&agrave;ng thuộc ph&acirc;n kh&uacute;c b&igrave;nh d&acirc;n với m&agrave;n h&igrave;nh lớn nhưng vẫn gọn nhẹ hợp t&uacute;i tiền.</h3>\r\n\r\n<h3>Thiết kế si&ecirc;u mỏng nhẹ</h3>\r\n\r\n<p>Galaxy Tab A7 Lite sở hữu kiểu thiết kế đặc trưng của d&ograve;ng Galaxy Tab A7. Thiết bị sử dụng chất liệu nh&ocirc;m với thiết kế nguy&ecirc;n khối gi&uacute;p cho m&aacute;y trở n&ecirc;n cao cấp hơn d&ugrave; chỉ thuộc ph&acirc;n kh&uacute;c tầm trung gi&aacute; rẻ.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/237325/samsung-galaxy-tab-a7-lite-002.jpg\" onclick=\"return false;\"><img alt=\"Galaxy Tab A7 Lite | Thiết kế mặt lưng\" src=\"https://cdn.tgdd.vn/Products/Images/522/237325/samsung-galaxy-tab-a7-lite-002.jpg\" /></a></p>\r\n\r\n<p>Tuy được ho&agrave;n thiện từ nh&ocirc;m nguy&ecirc;n khối, nhưng Galaxy Tab A7 Lite vẫn c&oacute; độ mỏng nhẹ ấn tượng khi chỉ nặng 371 g v&agrave; d&agrave;y chỉ 8 mm, mang đến sự thoải m&aacute;i khi cầm sử dụng trong thời gian d&agrave;i.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/237325/samsung-galaxy-tab-a7-lite-004.jpg\" onclick=\"return false;\"><img alt=\"Galaxy Tab A7 Lite | Thiết kế cạnh viền\" src=\"https://cdn.tgdd.vn/Products/Images/522/237325/samsung-galaxy-tab-a7-lite-004.jpg\" /></a></p>\r\n\r\n<p>Với k&iacute;ch thước chỉ tương đương với một quyển sổ n&ecirc;n&nbsp;Galaxy Tab A7 Lite sẽ&nbsp;v&ocirc; c&ugrave;ng gọn g&agrave;ng để bạn c&oacute; thể mang theo khi cần thiết.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/237325/samsung-galaxy-tab-a7-lite-009.jpg\" onclick=\"return false;\"><img alt=\"Galaxy Tab A7 Lite | Thiết kế gọn ràng, cầm nắm thoải mái\" src=\"https://cdn.tgdd.vn/Products/Images/522/237325/samsung-galaxy-tab-a7-lite-009.jpg\" /></a></p>', '<p><img src=\"data:image/png;base64,\" /></p>', '4490000', 'samsung-galaxy-tab-a7-lite-gray-600x60036.jpg', 0, 0, NULL, NULL);
