(33, 'Máy tính bảng iPad Pro M1 12.9 inch WiFi Cellular 256GB (2021)', 10, 6, '<h3>M&aacute;y t&iacute;nh bảng&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang/ipad-pro-m1-129-inch-wifi-cellular-256gb-2021\" target=\"_blank\">iPad Pro M1 12.9 inch Wifi Cellular 256GB (2021)</a>&nbsp;trang bị con chip v&ocirc; c&ugrave;ng mạnh mẽ M1 c&ugrave;ng c&ocirc;ng nghệ m&agrave;n h&igrave;nh mới mini-LED được rất nhiều người d&ugrave;ng đ&oacute;n nhận nồng nhiệt v&agrave; đ&aacute;nh gi&aacute; rất tốt sản phẩm n&agrave;y đến từ&nbsp;<a href=\"https://www.thegioididong.com/apple\" target=\"_blank\">Apple</a>.</h3>\r\n\r\n<h3>Hơn cả một chiếc&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang\" target=\"_blank\">m&aacute;y t&iacute;nh bảng</a>&nbsp;cầm tay</h3>\r\n\r\n<p><a href=\"https://www.thegioididong.com/may-tinh-bang-apple-ipad-m1\" target=\"_blank\">iPad Pro M1</a>&nbsp;12.9 inch 2021 sử dụng chip M1 8 nh&acirc;n, Apple c&ocirc;ng bố chip M1 c&oacute; hiệu năng CPU nhanh hơn 50% v&agrave; GPU nhanh hơn 40%, đồng thời tiết kiệm năng lượng hơn so với người tiền nhiệm. Đ&acirc;y ch&iacute;nh l&agrave; lợi thế cạnh tranh gi&uacute;p m&aacute;y đ&aacute;nh bại c&aacute;c d&ograve;ng m&aacute;y kh&aacute;c trong c&ugrave;ng ph&acirc;n kh&uacute;c.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-1.jpg\" onclick=\"return false;\"><img alt=\"iPad Pro M1 12.9 inch WiFi Cellular 256GB (2021) | Sử dụng chip M1 8 nhân\" src=\"https://cdn.tgdd.vn/Products/Images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-1.jpg\" /></a></p>\r\n\r\n<p>Sức mạnh chưa bao giờ l&agrave; vấn đề với m&aacute;y khi thiết bị ho&agrave;n to&agrave;n c&oacute; thể đ&aacute;p ứng được nhiều nhu cầu sử dụng kh&aacute;c nhau từ việc giải tr&iacute; nghe nhạc, xem phim, chơi game cấu h&igrave;nh cao, cho đến kết nối mạng học trực tuyến đều đ&aacute;p ứng rất tốt.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-18.jpg\" onclick=\"return false;\"><img alt=\"iPad Pro M1 12.9 inch WiFi Cellular 256GB (2021) | Đáp ứng tốt nhu cầu giải trí nghe nhạc, xem phim, chơi game cấu hình cao\" src=\"https://cdn.tgdd.vn/Products/Images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-18.jpg\" /></a></p>\r\n\r\n<p>Chưa kể, m&aacute;y được sở hữu&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang-ram-8gb\" target=\"_blank\">RAM 8 GB</a>&nbsp;đảm bảo xử l&yacute; đa nhiệm vượt trội,&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang-rom-256gb\" target=\"_blank\">bộ nhớ trong 256 GB</a>&nbsp;lưu trữ thoải m&aacute;i v&agrave; hệ điều h&agrave;nh iPadOS 14 rất trực quan, dễ sử dụng v&agrave; chứa h&agrave;ng loạt c&aacute;c t&iacute;nh năng hay ho chờ người d&ugrave;ng kh&aacute;m ph&aacute;.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-14.jpg\" onclick=\"return false;\"><img alt=\"iPad Pro M1 12.9 inch WiFi Cellular 256GB (2021) | RAM 8 GB, bộ nhớ trong 256 GB cùng hệ điều hành iPadOS 14 rất trực quan\" src=\"https://cdn.tgdd.vn/Products/Images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-14.jpg\" /></a></p>\r\n\r\n<p>B&ecirc;n cạnh hỗ trợ Wifi 6, c&ocirc;ng nghệ 5G t&iacute;ch hợp tr&ecirc;n m&aacute;y ch&iacute;nh l&agrave; thứ khiến người d&ugrave;ng sẵn s&agrave;ng &ldquo;m&oacute;c hầu bao&rdquo; để rinh chiếc m&aacute;y về cho ri&ecirc;ng m&igrave;nh.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-2.jpg\" onclick=\"return false;\"><img alt=\"iPad Pro M1 12.9 inch WiFi Cellular 256GB (2021) | Công nghệ 5G được tích hợp\" src=\"https://cdn.tgdd.vn/Products/Images/522/238651/ipad-pro-m1-12-9-inch-wifi-cellular-256gb-2021-2.jpg\" /></a></p>', '<p><img src=\"data:image/png;base64,\" /></p>', '38490000', 'ipad-pro-2021-129-inch-silver-600x60063.jpg', 0, 0, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(34, 'Laptop Acer Aspire 7 Gaming A715 41G R150 R7 3750H/8GB/512GB/4GB', 9, 11, '<p><a href=\"https://www.thegioididong.com/laptop/acer-aspire-7-a715-41g-r150-r7-nhq8ssv004\" target=\"_blank\">Acer Aspire 7 A715 41G R150 R7 (NH.Q8SSV.004)</a>&nbsp;được thi&ecirc;́t k&ecirc;́ gọn gàng với c&acirc;́u hình mạnh mẽ nhờ CPU AMD Ryzen 7 v&agrave; card đồ hoạ NVIDIA GeForce GTX 1650Ti gi&uacute;p t&ocirc;́i ưu trải nghi&ecirc;̣m chơi game, đ&aacute;p ứng đa dạng nhu c&acirc;̀u sử dụng.</p>\r\n\r\n<h3>Hiệu năng mạnh mẽ với chip&nbsp;<a href=\"https://www.thegioididong.com/laptop-cpu-amd\" target=\"_blank\">AMD</a>&nbsp;Ryzen 7</h3>\r\n\r\n<p><a href=\"https://www.thegioididong.com/laptop-acer-aspire\" target=\"_blank\">Acer Aspire</a>&nbsp;sở hữu bộ vi xử l&yacute;&nbsp;<strong>3750H</strong>&nbsp;từ nh&agrave; AMD với tốc độ&nbsp;<strong>CPU 2.30 GHz</strong>&nbsp;v&agrave; &eacute;p xung nhờ&nbsp;<strong>Turbo Boost</strong>&nbsp;l&ecirc;n đến&nbsp;<strong>4.0 GHz,&nbsp;</strong>được sản xuất tr&ecirc;n tiến tr&igrave;nh 12 nm cho tốc độ xử l&yacute; nhanh ch&oacute;ng ở mọi t&aacute;c vụ c&ocirc;ng việc học tập văn ph&ograve;ng cho đến đồ hoạ v&agrave; chơi game.&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://www.thegioididong.com/laptop-8-gb\" target=\"_blank\">RAM 8 GB</a>&nbsp;DDR4 (2 khe)</strong>&nbsp;với tốc độ Bus RAM<strong>&nbsp;2400 MHz</strong>&nbsp;cho ph&eacute;p bạn chạy nhiều chương tr&igrave;nh c&ugrave;ng l&uacute;c hay mở từ ứng dụng n&agrave;y sang ứng dụng kh&aacute;c vẫn trơn tru m&agrave; kh&ocirc;ng lo hiện tượng giật, lag.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/239538/acer-aspire-7-a715-41g-r150-r7-nhq8ssv004-4-1.jpg\" onclick=\"return false;\"><img alt=\"Acer Aspire 7 A715 41G R150 R7 3750H (NH.Q8SSV.004.) - Cấu hình\" src=\"https://cdn.tgdd.vn/Products/Images/44/239538/acer-aspire-7-a715-41g-r150-r7-nhq8ssv004-4-1.jpg\" /></a></p>\r\n\r\n<p><strong><a href=\"https://www.thegioididong.com/laptop?g=ssd-512-gb\" target=\"_blank\">SSD 512 GB</a>&nbsp;NVMe PCIe</strong>&nbsp;cho tốc độ khởi động m&aacute;y, mở ứng dụng, tải game, chạy đa nhiệm cực kỳ mượt m&agrave; v&agrave; nhanh ch&oacute;ng chỉ v&agrave;i gi&acirc;y, bạn sẽ kh&ocirc;ng cần phải mất nhiều thời gian chờ đợi nữa.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/239538/acer-aspire-7-a715-41g-r150-r7-nhq8ssv004-6-1.jpg\" onclick=\"return false;\"><img alt=\"Acer Aspire 7 A715 41G R150 R7 3750H (NH.Q8SSV.004.) - SSD\" src=\"https://cdn.tgdd.vn/Products/Images/44/239538/acer-aspire-7-a715-41g-r150-r7-nhq8ssv004-6-1.jpg\" /></a></p>\r\n\r\n<p>Card đồ hoạ&nbsp;<a href=\"https://www.thegioididong.com/laptop-geforce-gtx\" target=\"_blank\">NVIDIA GeForce GTX 1650Ti 4 GB</a>&nbsp;cho bạn th&ecirc;m nhiều sức mạnh hơn từ kiến tr&uacute;c đồ họa&nbsp;<strong>Turing&nbsp;</strong>ti&ecirc;n tiến. Bạn c&oacute; thể chơi tốt mọi tựa game phổ biến như PUBG, FIFA Online 4, Li&ecirc;n Minh Huyền Thoại,... hay chỉnh h&igrave;nh ảnh, video tr&ecirc;n c&aacute;c ứng dụng Adobe một c&aacute;ch mượt m&agrave;, trơn tru.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/239538/acer-aspire-7-a715-41g-r150-r7-nhq8ssv004-5-1.jpg\" onclick=\"return false;\"><img alt=\"Acer Aspire 7 A715 41G R150 R7 3750H (NH.Q8SSV.004.) - Card đồ hoạ\" src=\"https://cdn.tgdd.vn/Products/Images/44/239538/acer-aspire-7-a715-41g-r150-r7-nhq8ssv004-5-1.jpg\" /></a></p>', '<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<p>&nbsp;</p>', '20490000', 'acer-aspire-7-a715-41g-r150-r7-nhq8ssv004-600x60093.jpg', 0, 1, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(35, 'Laptop Apple MacBook Pro M1 2020 8GB/256GB/Space Grey', 9, 6, '<h3><a href=\"https://www.thegioididong.com/laptop/apple-macbook-pro-2020-m1-myd82saa\" target=\"_blank\">Apple Macbook Pro M1 2020 (MYD82SA/A)</a>&nbsp;sở hữu thiết kế sang trọng từ kim loại nguy&ecirc;n khối được kế thừa từ c&aacute;c thế hệ trước nhưng b&ecirc;n trong l&agrave; một cấu h&igrave;nh cực kỳ đ&aacute;ng gờm. Với chip M1 lần đầu ti&ecirc;n xuất hiện tr&ecirc;n MacBook Pro, hiệu năng CPU của m&aacute;y tăng đến 2.8 lần, hiệu năng GPU tăng 5 lần.</h3>\r\n\r\n<h3>Thiết kế nguy&ecirc;n khối từ kim loại t&aacute;i chế</h3>\r\n\r\n<p>Vẫn l&agrave; thiết kế kim loại nguy&ecirc;n khối sang trọng thường thấy ở c&aacute;c thế hệ trước, phi&ecirc;n bản&nbsp;<a href=\"https://www.thegioididong.com/laptop-apple-macbook-pro\" target=\"_blank\">MacBook Pro</a>&nbsp;lần n&agrave;y mỏng nhẹ chỉ<strong>&nbsp;15.6 mm</strong>, trọng lượng<strong>&nbsp;1.4 kg</strong>&nbsp;c&oacute; thể tự tin đồng h&agrave;nh c&ugrave;ng bạn đến bất cứ đ&acirc;u.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043820-083821.jpg\" onclick=\"return false;\"><img alt=\"Apple Macbook Pro 2020 (MYD82SA/A) - Thiết kế\" src=\"https://cdn.tgdd.vn/Products/Images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043820-083821.jpg\" /></a></p>\r\n\r\n<p>B&agrave;n ph&iacute;m Magic tr&ecirc;n m&aacute;y được Apple cho l&agrave; đ&atilde; khắc phục hầu hết c&aacute;c nhược điểm của b&agrave;n ph&iacute;m C&aacute;nh bướm tr&ecirc;n c&aacute;c thế hệ trước. Với đ&egrave;n nền v&agrave; c&aacute;c ph&iacute;m tắt, bạn c&oacute; thể xử l&yacute; c&ocirc;ng việc một c&aacute;ch thuận tiện hơn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043320-083333.jpg\" onclick=\"return false;\"><img alt=\"Apple Macbook Pro 2020 (MYD82SA/A) - Bàn phím\" src=\"https://cdn.tgdd.vn/Products/Images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043320-083333.jpg\" /></a></p>\r\n\r\n<p>Apple trang bị cho&nbsp;<a href=\"https://www.thegioididong.com/laptop-apple-macbook\" target=\"_blank\">MacBook</a>&nbsp;Pro 2020 chip bảo mật T2 m&atilde; h&oacute;a dữ liệu ổ cứng c&ugrave;ng với cảm biến v&acirc;n tay nhỏ gọn được t&iacute;ch hợp gi&uacute;p bạn c&oacute; thể mở m&aacute;y nhanh ch&oacute;ng, kh&ocirc;ng cần mất thời gian nhập mật m&atilde;, thanh to&aacute;n trực tuyến dễ d&agrave;ng.&nbsp;</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/laptop\" target=\"_blank\">Laptop</a>&nbsp;trang bị 2 cổng Thunderbolt 3 (USB-C) truyền dữ liệu cực nhanh l&ecirc;n đến 40 Gb/s để xuất dữ liệu sang m&agrave;n h&igrave;nh, m&aacute;y chiếu, chia sẻ th&ocirc;ng tin dễ d&agrave;ng.&nbsp;</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043020-083040.jpg\" onclick=\"return false;\"><img alt=\"Apple Macbook Pro 2020 (MYD82SA/A) - cổng kết nối \" src=\"https://cdn.tgdd.vn/Products/Images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043020-083040.jpg\" /></a></p>\r\n\r\n<h3>Hiệu năng đồ họa cao gấp 2.8 lần đời trước với chip M1 mới</h3>\r\n\r\n<p>MacBook Pro 2020 sử dụng&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/tim-hieu-ve-chip-apple-m1-con-chip-arm-5nm-dau-tien-danh-1305955\" target=\"_blank\"><strong>con chip M1</strong></a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/laptop-8-gb\" target=\"_blank\"><strong>RAM 8 GB</strong></a>. Con chip n&agrave;y được Apple thiết kế ri&ecirc;ng cho MacBook&nbsp;được ph&aacute;t triển với kiến tr&uacute;c ARM mới, với CPU 8 l&otilde;i v&agrave; GPU 8 l&otilde;i&nbsp;cho hiệu suất cao hơn đến 3.5 lần so với thế hệ trước, hiệu suất đồ họa cao hơn gấp 5 lần. Xử l&iacute; h&igrave;nh ảnh hoặc dụng vlog, l&agrave;m poster đều tốt, hỗ trợ xuất video 4K.</p>\r\n\r\n<p>RAM 8 GB cho ph&eacute;p sử dụng c&ugrave;ng l&uacute;c nhiều ứng dụng, bạn c&oacute; thể sử dụng m&aacute;y để lướt web, soạn thảo hay thiết kế với Photoshop, Ai, Premiere mượt m&agrave;.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043020-083029.jpg\" onclick=\"return false;\"><img alt=\"Apple Macbook Pro 2020 (MYD82SA/A) - cấu hình\" src=\"https://cdn.tgdd.vn/Products/Images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043020-083029.jpg\" /></a></p>\r\n\r\n<p>Nhờ c&oacute;&nbsp;<strong><a href=\"https://www.thegioididong.com/laptop-o-cung-ssd\" target=\"_blank\">ổ cứng SSD</a>&nbsp;256 GB</strong>, mọi thao t&aacute;c đều được xử l&iacute; nhanh, mở m&aacute;y chỉ trong 10 gi&acirc;y. Đi k&egrave;m l&agrave; kh&ocirc;ng gian lưu trữ&nbsp;<strong><a href=\"https://www.thegioididong.com/laptop?g=ssd-256-gb\" target=\"_blank\">256 GB</a></strong>&nbsp;gi&uacute;p bạn thoải m&aacute;i lưu c&aacute;c tựa phim, file Photoshop nặng.</p>\r\n\r\n<p>MacBook Pro c&oacute; thời lượng sử dụng ấn tượng l&ecirc;n đến&nbsp;<strong>18 giờ</strong>&nbsp;li&ecirc;n tục. Thoải m&aacute;i l&agrave;m việc hay mang theo trong c&aacute;c chuyến đi ngắn ng&agrave;y, kh&ocirc;ng cần lo lắng bị gi&aacute;n đoạn c&ocirc;ng việc.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043720-083717.jpg\" onclick=\"return false;\"><img alt=\"Apple Macbook Pro 2020 (MYD82SA/A) - ssd\" src=\"https://cdn.tgdd.vn/Products/Images/44/231253/apple-macbook-pro-2020-m1-myd82saa-043720-083717.jpg\" /></a></p>\r\n\r\n<p>B&ecirc;n cạnh những n&acirc;ng cấp về hiệu năng th&igrave; kho ứng dụng tr&ecirc;n macOS cũng được cập nhật, n&acirc;ng cấp lại để tương th&iacute;ch với con chip mới v&agrave; được cải thiện ở số lượng nhiều hơn. Bạn c&oacute; thể tham khảo những&nbsp;<a href=\"https://www.thegioididong.com/game-app/danh-sach-ung-dung-chay-duoc-tren-macbook-chip-apple-m1-1310311\" target=\"_blank\">ứng dụng tương th&iacute;ch với Macbook sở hữu con chip M1</a>.</p>', '<ul>\r\n	<li>\r\n	<p><img src=\"data:image/png;base64,\" /></p>\r\n	</li>\r\n</ul>', '34990000', 'apple-macbook-pro-2020-m1-myd82saa-043020-08302924.jpg', 0, 1, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(36, 'Điện thoại Samsung Galaxy S20 FE (8GB/256GB)', 8, 7, '<h3><a href=\"https://www.thegioididong.com/samsung\" target=\"_blank\">Samsung</a>&nbsp;đ&atilde; giới thiệu đến người d&ugrave;ng th&agrave;nh vi&ecirc;n mới của d&ograve;ng&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">điện thoại th&ocirc;ng minh</a>&nbsp;S20 Series đ&oacute; ch&iacute;nh l&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-s20-fan-edition\" target=\"_blank\">Samsung Galaxy S20 FE</a>. Đ&acirc;y l&agrave; mẫu flagship cao cấp quy tụ nhiều t&iacute;nh năng m&agrave; Samfan y&ecirc;u th&iacute;ch, hứa hẹn sẽ mang lại trải nghiệm cao cấp của d&ograve;ng Galaxy S với mức gi&aacute; dễ tiếp cận hơn.</h3>\r\n\r\n<h3>Nhiếp ảnh chuy&ecirc;n nghiệp với cụm camera đẳng cấp</h3>\r\n\r\n<p>Camera tr&ecirc;n S20 FE l&agrave; 3 cảm biến chất lượng nằm gọn trong m&ocirc; đun chữ nhật độc đ&aacute;o ở mặt lưng bao gồm: Camera ch&iacute;nh 12 MP cho chất lượng ảnh sắc n&eacute;t,&nbsp;<a href=\"https://xn--tham%20kho%20in%20thoi%20c%20camera%20gc%20rng%20ti%20th%20gii%20di%20ng-v4gn63tyby8599a5a6iy2igrv2c3a1n/\" target=\"_blank\">camera g&oacute;c si&ecirc;u rộng</a>&nbsp;12 MP cung cấp g&oacute;c chụp tối đa v&agrave; cuối c&ugrave;ng camera tele 8 MP hỗ trợ zoom quang 3X.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/224859/samsung-galaxy-s20-fan-edition-122420-082417.jpg\" onclick=\"return false;\"><img alt=\"Cụm 3 camera chất lượng đa tính năng - Samsung Galaxy S20 FE\" src=\"https://cdn.tgdd.vn/Products/Images/42/224859/samsung-galaxy-s20-fan-edition-122420-082417.jpg\" /></a></p>\r\n\r\n<p>Với hệ thống camera n&agrave;y, tất nhi&ecirc;n S20 FE sẽ kh&ocirc;ng thể thiếu những t&iacute;nh năng camera h&agrave;ng đầu như&nbsp;<a href=\"https://www.thegioididong.com/dtdd-camera-xoa-phong\" target=\"_blank\">chụp x&oacute;a ph&ocirc;ng</a>, tự động lấy n&eacute;t (AF),&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/che-do-chong-rung-quang-hoc-ois-chup-anh-tren-sm-906416\" target=\"_blank\">chống rung quang học OIS</a>,... gi&uacute;p bạn dễ d&agrave;ng nhiếp ảnh với c&aacute;c vật thể đang di chuyển m&agrave; vẫn giữ được chất lượng khung h&igrave;nh v&agrave; độ sắc n&eacute;t cao.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/224859/samsung-galaxy-s20-fan-edition-122520-082533.jpg\" onclick=\"return false;\"><img alt=\"Cụm camera tích hợp các chế độ chụp nâng cao - Samsung Galaxy S20 FE\" src=\"https://cdn.tgdd.vn/Products/Images/42/224859/samsung-galaxy-s20-fan-edition-122520-082533.jpg\" /></a></p>\r\n\r\n<p>Sự kết hợp giữa ống k&iacute;nh zoom quang học 3X v&agrave; thu ph&oacute;ng si&ecirc;u ph&acirc;n giải l&ecirc;n đến 30X cho ph&eacute;p bạn ph&oacute;ng to mọi chi tiết ở khoảng c&aacute;ch xa đến lại gần hơn bạn m&agrave; kh&ocirc;ng ảnh hưởng đến chất lượng h&igrave;nh ảnh.</p>\r\n\r\n<p>Ngay cả trong điều kiện thiếu s&aacute;ng th&igrave; camera của S20 FE vẫn kh&ocirc;ng l&agrave;m bạn thất vọng khi cho khả năng chụp đ&ecirc;m ấn tượng với cảm biến Dual Pixel gi&uacute;p thu s&aacute;ng tốt, khử nhiễu đa khung h&igrave;nh cho bức ảnh trong m&agrave;n đ&ecirc;m của bạn trở n&ecirc;n sống động, r&otilde; n&eacute;t hơn.</p>\r\n\r\n<p>Với camera selfie 32 MP t&iacute;ch hợp c&aacute;c chế độ l&agrave;m đẹp AI, x&oacute;a ph&ocirc;ng sẽ gi&uacute;p bạn c&oacute; ngay những tấm ảnh selfie cuốn h&uacute;t, tỏa s&aacute;ng c&ugrave;ng bạn b&egrave; trong từng khung h&igrave;nh.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/224859/samsung-galaxy-s20-fan-edition-122820-082802.jpg\" onclick=\"return false;\"><img alt=\"Camera selfie 32 MP hỗ trợ tính năng làm đẹp AI, quay video Full HD - Samsung Galaxy S20 FE\" src=\"https://cdn.tgdd.vn/Products/Images/42/224859/samsung-galaxy-s20-fan-edition-122820-082802.jpg\" /></a></p>', '<p><img src=\"data:image/png;base64,\" /></p>', '11990000', 'samsung-galaxy-s20-fan-edition-090320-040338-600x60056.jpg', 0, 1, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(37, 'Điện thoại Xiaomi Redmi Note 10 5G 8GB (2021)', 8, 5, '<h3><a href=\"https://www.thegioididong.com/dtdd/xiaomi-redmi-note-10-5g\" target=\"_blank\">Redmi Note 10 5G</a>&nbsp;một trong những mẫu&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">điện thoại</a>&nbsp;thuộc series&nbsp;<a href=\"https://www.thegioididong.com/dtdd/xiaomi-redmi-note-10\" target=\"_blank\">Redmi Note 10</a>&nbsp;của&nbsp;<a href=\"https://www.thegioididong.com/dtdd-xiaomi\" target=\"_blank\">Xiaomi</a>, kh&ocirc;ng chỉ sở hữu hiệu năng mạnh mẽ đ&aacute;p ứng tốt nhu cầu&nbsp;<a href=\"https://www.thegioididong.com/dtdd-choi-game\" target=\"_blank\">chơi game</a>, đ&acirc;y c&ograve;n l&agrave; chiếc điện thoại c&oacute; hỗ trợ mạng 5G cho tốc độ kết nối nhanh ch&oacute;ng.</h3>\r\n\r\n<h3>Cấu h&igrave;nh mạnh tối ưu cho nhu cầu chơi game</h3>\r\n\r\n<p>Redmi Note 10 5G trang bị vi xử l&yacute; 8 nh&acirc;n Dimensity 700 của MediaTek sản xuất tr&ecirc;n tiến tr&igrave;nh 7 nm ti&ecirc;n tiến, hứa hẹn hiệu năng mạnh mẽ cho mọi t&aacute;c vụ h&agrave;ng ng&agrave;y nhanh ch&oacute;ng hơn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/235971/xiaomi-redmi-note-10-5g-8.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Note 10 5G | Trang bị vi xử lý 8 nhân Dimensity 700 của MediaTek\" src=\"https://cdn.tgdd.vn/Products/Images/42/235971/xiaomi-redmi-note-10-5g-8.jpg\" /></a></p>\r\n\r\n<p>Được biết đ&acirc;y l&agrave; d&ograve;ng chip được tối ưu cho nhu cầu chơi game. V&igrave; thế, smartphone tầm trung của Xiaomi ho&agrave;n to&agrave;n đảm đương ổn định c&aacute;c tựa game hiện nay một c&aacute;ch mượt m&agrave;.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/235971/xiaomi-redmi-note-10-5g-7.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Note 10 5G | Chiến các tựa game hiện nay một cách mượt mà\" src=\"https://cdn.tgdd.vn/Products/Images/42/235971/xiaomi-redmi-note-10-5g-7.jpg\" /></a></p>\r\n\r\n<p>Với&nbsp;<a href=\"https://www.thegioididong.com/dtdd-ram-8gb\">8&nbsp;GB RAM</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd-rom-128gb\" target=\"_blank\">128 GB</a>&nbsp;bộ nhớ trong, Redmi Note 10 5G đ&aacute;p ứng ở mức ổn khả năng đa nhiệm v&agrave; cung cấp kh&ocirc;ng gian lưu trữ lớn gi&uacute;p bạn thỏa sức lưu trữ dữ liệu.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/235971/xiaomi-redmi-note-10-5g-0006.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Note 10 5G | 8 GB RAM và 128 GB bộ nhớ trong\" src=\"https://cdn.tgdd.vn/Products/Images/42/235971/xiaomi-redmi-note-10-5g-0006.jpg\" /></a></p>\r\n\r\n<p>T&iacute;ch hợp modem 5G, với tốc độ kết nối vượt xa 4G, truy cập mạng nhanh ch&oacute;ng hơn ở bất kỳ đ&acirc;u, hỗ trợ 2 chế độ SA/NSA v&agrave; bố tr&iacute; dải anten th&ocirc;ng minh gi&uacute;p cho smartphone 5G của Xiaomi c&oacute; thể thu s&oacute;ng tốt trong điều kiện mạng k&eacute;m, chập chờn.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/235971/xiaomi-redmi-note-10-5g-9.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Note 10 5G | Tích hợp modem 5G truy cập mạng nhanh chóng\" src=\"https://cdn.tgdd.vn/Products/Images/42/235971/xiaomi-redmi-note-10-5g-9.jpg\" /></a></p>', '<p><img src=\"data:image/png;base64,\" /></p>', '5990000', 'xiaomi-redmi-note-10-5g-xanh-cuc-quang-200x20035.jpg', 0, 0, NULL, NULL);
INSERT INTO `tbl_product` (`product_id`, `product_name`, `category_id`, `brand_id`, `product_describe`, `product_content`, `product_price`, `product_image`, `product_status`, `product_new`, `created_at`, `updated_at`) VALUES
(38, 'Điện thoại iPhone 12 Pro Max 128GB (2020) bản chính thức', 8, 6, '<p>&nbsp;</p>\r\n\r\n<h3><a href=\"https://www.thegioididong.com/dtdd/iphone-12-pro-max\" target=\"_blank\">iPhone 12 Pro Max 128 GB</a>&nbsp;một si&ecirc;u phẩm&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">smartphone</a>&nbsp;đến từ&nbsp;<a href=\"https://www.thegioididong.com/apple\" target=\"_blank\">Apple</a>. M&aacute;y c&oacute; một hiệu năng ho&agrave;n to&agrave;n mạnh mẽ đ&aacute;p ứng tốt nhiều nhu cầu đến từ người d&ugrave;ng v&agrave; mang trong m&igrave;nh một thiết kế đầy vu&ocirc;ng vức, sang trọng.</h3>\r\n\r\n<h3>Thay đổi thiết kế mới sau 6 năm</h3>\r\n\r\n<p>Theo chu kỳ cứ mỗi 3 năm th&igrave; iPhone lại thay đổi thiết kế v&agrave; 2020 l&agrave; năm đ&aacute;nh dấu cột mốc quan trong n&agrave;y, v&igrave; thế rất c&oacute; thể đ&acirc;y l&agrave; thời điểm c&aacute;c mẫu&nbsp;<a href=\"https://www.thegioididong.com/dtdd/iphone-12\" target=\"_blank\">iPhone 12</a>&nbsp;sẽ c&oacute; một sự thay đổi mạnh mẽ về thiết kế.</p>\r\n\r\n<p>iPhone 12 Pro Max sở hữu diện mạo mới mới với khung viền được v&aacute;t thẳng v&agrave; mạnh mẽ như tr&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang/ipad-pro-12-9-inch-wifi-128gb-2020\" target=\"_blank\">iPad Pro 2020</a>, chấm dứt hơn 6 năm với kiểu thiết kế bo cong tr&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dtdd/iphone-6-32gb-gold\" target=\"_blank\">iPhone 6</a>&nbsp;được ra mắt lần đầu ti&ecirc;n v&agrave;o năm 2014.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/213033/iphone-12-pro-max-2-1.jpg\" onclick=\"return false;\"><img alt=\"Sự thay đổi về thiết kế vượt trội | iPhone 12 Pro Max\" src=\"https://cdn.tgdd.vn/Products/Images/42/213033/iphone-12-pro-max-2-1.jpg\" /></a></p>\r\n\r\n<p>Nếu iPad Pro 2020 sử dụng chất liệu nh&ocirc;m nguy&ecirc;n khối, th&igrave; iPhone 12 Pro Max sẽ l&agrave; chất liệu mặt k&iacute;nh c&ugrave;ng khung viền th&eacute;p, l&agrave;m người d&ugrave;ng gợi nhớ nhiều hơn về bộ đ&ocirc;i iPhone 4 /4s huyền thoại với thiết kế đẹp nhất trong lịch sử thiết kế của Apple.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/213033/iphone-12-pro-max-4-1.jpg\" onclick=\"return false;\"><img alt=\"Mặt lưng bằng kính, khung viền thép được thiết kế cho máy | iPhone 12 Pro Max\" src=\"https://cdn.tgdd.vn/Products/Images/42/213033/iphone-12-pro-max-4-1.jpg\" /></a></p>\r\n\r\n<p>Sự kh&aacute;c biệt với bộ đ&ocirc;i 4/4s nằm ở phần mặt k&iacute;nh của iPhone 12 Pro Max được l&agrave;m cong nhẹ, gi&uacute;p &ocirc;m kh&iacute;t khung viền ho&agrave;n hảo tạo sự liền mạch của m&agrave;n h&igrave;nh khi cầm nắm sử dụng.</p>\r\n\r\n<p>iPhone 12 Pro Max sẽ c&oacute; độ mỏng ấn tượng chỉ 7,4 mm tức c&ograve;n mỏng hơn khoảng 10% so với&nbsp;<a href=\"https://www.thegioididong.com/dtdd/iphone-11-pro-max\" target=\"_blank\">iPhone 11 Pro Max</a>&nbsp;hiện nay đang l&agrave; 8,1 mm. Điều n&agrave;y c&agrave;ng l&agrave;m tăng sự quyến rũ, đẳng cấp cho thiết bị từ mọi g&oacute;c nh&igrave;n.</p>\r\n\r\n<p><a href=\"https://www.thegioididong.com/images/42/213033/iphone-12-pro-max-6-1.jpg\" onclick=\"return false;\"><img alt=\"Thiết kế bắt mắt từ mọi góc nhìn | iPhone 12 Pro Max\" src=\"https://cdn.tgdd.vn/Products/Images/42/213033/iphone-12-pro-max-6-1.jpg\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', '<h3><img src=\"data:image/png;base64,\" style=\"height:555px; width:624px\" /></h3>\r\n\r\n<ul>\r\n</ul>', '32990000', 'iphone-12-pro-max-xam-new-600x600-200x20044.jpg', 0, 1, NULL, NULL);

